import Amime from '../../asset/anime';
import React from "react"


const btn = {
  position: 'absolute',
  top: 120,
  left: 100,
}

export default function Visual() {

  const box = useRef(null);

  return (
    <figure id="visual">
      <button
      style={btn}
      onClick={() => {
        new Anime(box.current, {
          prop: 'left',
          value: 1000,
          duration: 500,
        })
      }}

      >button</button>

    </figure>
  )
}
